import React, { useState, useEffect } from "react";
import axios from "axios";

const QuestionsDisplay = () => {
  const [questions, setQuestions] = useState([
    {
      name: "jiajia",
      category: "animal",
      description: "NAH",
    },
  ]);
  useEffect(() => {
    const fetchData = async () => {
      const questions = await axios
        .get("http://localhost:5000/questions")
        .then(setQuestions(questions));
      //console.log("questions", questions);
    };
    fetchData();
  }, []);
  const listComponents = [];
  const Collections = ({ name, category, description }) => {
    return (
      <div className="card">
        <ul className="list-group">
          <li className="list-group-item">Name: {name}</li>
          <li className="list-group-item">Time: {category}</li>
          <li className="list-group-item">Zoom: {description}</li>
        </ul>
      </div>
    );
  };

  for (let i = 0; i < questions.length; i++) {
    listComponents.push(<Collections />);
  }

  return (
    <div>
      this is questions display
      {listComponents}
    </div>
  );
};
export default QuestionsDisplay;
